import React from 'react';
import { useGlobalContext } from '../../context';

const FaceRecognition = () => {
  const { imageUrl } = useGlobalContext();

  return (
    <div className="center">
      <img src={imageUrl} alt="sample" />
    </div>
  );
};

export default FaceRecognition;
